import React from 'react';
import {NavLink} from 'react-router-dom';

const active ={
    color : "red",
    borderBottom : "yellow"
}

const Menu = () => {
return(
    <>
    <NavLink to="/" exact activeClassName={active} > home </NavLink>
    <NavLink to="/poke" activeClassName={active}> pokemon </NavLink>
    </>
)
}
export default Menu
